import React from 'react';
import {Row, Col, Button} from 'reactstrap'
import Chip from '../../common/chip/chip'

class PaymentsTableRow extends React.Component {
  render() {

    let consumers = [];
    this.props.data.consumers.forEach(consumer => {
      consumers.push(<Chip
        link="/mollaahmadi.ir"
        haveCloseButton="false"
        avatarSrc={require("../../assets/img/users/user01.jpg")}
        label={consumer.username}
        // onDelete={() => this.deleteUser()}
      />);
    });
    return (
      <>
        <Col lg='12' className='d-lg-block d-none p-0'>

          <Row className=" m-0">
            <Col  className="notifications-table-header-col px-0 check-width">
              <div
                className="p-0 px-1 custom-control custom-control-alternative custom-checkbox">
                <input
                  className="custom-control-input"
                  id=" customCheckLogin"
                  type="checkbox"
                />
                <label
                  className="custom-control-label pr-1"
                  htmlFor=" customCheckLogin"
                >
                  <span className="signin-modal-text mr-3">
                  </span>
                </label>
              </div>
            </Col>
            <Col lg="1" className="notifications-table-header-col">
              <p>1</p>
            </Col>
            <Col lg="1" className="date-request">
              <span>{this.props.data.date}</span>
            </Col>
            <Col lg="3" className="justify-content-center d-flex my-auto">
          <span>
            {this.props.data.name}
          </span>
            </Col>
            <Col lg="2" className="justify-content-center d-flex my-auto">
              <span>{this.props.data.value}</span>
            </Col>

            <Col lg="2" className="justify-content-center d-flex my-auto">
              <span className="user-sender">
                <Chip
                  link="/mollaahmadi.ir"
                  haveCloseButton="false"
                  avatarSrc={require("../../assets/img/users/user01.jpg")}
                  label={this.props.data.group}
                  // onDelete={() => this.deleteUser()}
                />
              </span>
            </Col>

            <Col lg="2" className="justify-content-center d-flex my-auto">
              <span className="user-sender">{consumers}</span>
            </Col>

            <Col sm="11" className="ntr-hr"/>
          </Row>
        </Col>

        <Col md='6' xs='12' className='d-lg-none'>

        </Col>


      </>
    );
  }
}

export default PaymentsTableRow;
